 // getJWT(): string {\n    //     return this._jwt;\n    // }\n\n    verify(token: string): Promise {\n        logger.info('Verifying', token, this._dataManagerService.publicKey)\n        return new Promise((resolve, reject) => {\n            this.jwtService\n                .verifyAsync(token, { publicKey: this._dataManagerService.publicKey })\n                .then((response) => resolve(response))\n                .catch((err) => reject(err));\n        });\n    }\n\n    decode(token: string) {\n        return this.jwtService.decode(token);\n    }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/BaseModuleInterface.html":{"url":"interfaces/BaseModuleInterface.html","title":"interface - BaseModuleInterface","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  \n  BaseModuleInterface\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/interfaces/satellite.interface.ts\n        \n\n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Methods\n                        \n                    \n                    \n                        \n                            \n                                \n                                    \n                                        getFile\n                                    \n                                \n                                \n                                    \n                                        getInfo\n                                    \n                                \n                            \n                        \n                    \n                \n            \n        \n\n            \n    \n    \n        Methods\n    \n    \n   